import React, { useState } from "react";
import { Link } from "react-router-dom";

const NavBar = () => {
  return (
    <nav>
      <ul>
        <li>
          <img src="../../public/assets/Sunny.png" alt="s" />
        </li>
        <li>
          <Link to="/">Logo</Link>
        </li>
        <li>
          <Link to="/">About</Link>
        </li>
        <li>
          <input type="search" name="search" id="" />
        </li>
        <li>
          <Link to="/"></Link>
        </li>
        <li>
          <button>logOut</button>
        </li>
      </ul>
    </nav>
  );
};

export default NavBar;
